/*Table structure for table `tb_code_tl` */

DROP TABLE IF EXISTS `tb_code_tl`;

CREATE TABLE `tb_code_tl` (
  `CODE_ID` bigint(20) NOT NULL,
  `LANG` varchar(10) COLLATE utf8_bin NOT NULL,
