/*Table structure for table `tb_fnd_style_template` */

DROP TABLE IF EXISTS `tb_fnd_style_template`;

CREATE TABLE `tb_fnd_style_template` (
  `template_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '表ID，主键，供其他表做外键',
  `template_code` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '模板代码',
