  `template_content` longtext COLLATE utf8_bin NOT NULL COMMENT '模版内容',
  `is_horizontal` varchar(1) COLLATE utf8_bin DEFAULT 'N' COMMENT '是否横向',
  `log_flag` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '日志存储标识',
  `enabled_flag` varchar(1) COLLATE utf8_bin NOT NULL COMMENT '生效标识：Y:生效，N:失效',
  `program_id` int(11) DEFAULT NULL,
  `request_id` int(11) DEFAULT NULL,
  `object_version_number` bigint(20) NOT NULL DEFAULT '1' COMMENT '行版本号，用来处理锁',
  `CREATION_DATE` datetime NOT NULL,
  `CREATED_BY` int(11) NOT NULL DEFAULT '-1',
  `LAST_UPDATED_BY` int(11) NOT NULL DEFAULT '-1',
  `LAST_UPDATE_DATE` datetime NOT NULL,
  `LAST_UPDATE_LOGIN` int(11) DEFAULT NULL,
  `ATTRIBUTE_CATEGORY` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE1` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE2` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE3` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE4` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE5` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE6` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE7` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE8` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE9` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE10` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE11` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE12` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE13` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE14` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE15` varchar(150) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`template_id`),
  UNIQUE KEY `tb_fnd_style_template_U1` (`template_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='样式模板';

/*Data for the table `tb_fnd_style_template` */

insert  into `tb_fnd_style_template`(`template_id`,`template_code`,`template_name`,`template_content`,`is_horizontal`,`log_flag`,`enabled_flag`,`program_id`,`request_id`,`object_version_number`,`CREATION_DATE`,`CREATED_BY`,`LAST_UPDATED_BY`,`LAST_UPDATE_DATE`,`LAST_UPDATE_LOGIN`,`ATTRIBUTE_CATEGORY`,`ATTRIBUTE1`,`ATTRIBUTE2`,`ATTRIBUTE3`,`ATTRIBUTE4`,`ATTRIBUTE5`,`ATTRIBUTE6`,`ATTRIBUTE7`,`ATTRIBUTE8`,`ATTRIBUTE9`,`ATTRIBUTE10`,`ATTRIBUTE11`,`ATTRIBUTE12`,`ATTRIBUTE13`,`ATTRIBUTE14`,`ATTRIBUTE15`) values (3,'RS_SHIPMENT','发货单打印模板','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html>\n<head>\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\n<style mce_bogus=\"1\" type=\"text/css\">  \nbody {font-family: SimSun; background:none;margin-left: auto;margin-right: auto;}  \nh1{text-align:center;padding-bottom:-20px;text-decoration:underline}\nbody,html,div,p,span{ font-size:14px; margin:0px; padding:0px;}  \n.odd{width:65px;}\n.even{width:90px;}\n.opp{width:40px;}\n</style> \n</head>\n<body>\n<h1>发货单</h1>\n<h1>上海王的实业有限公司</h1>\n<div style=\"float:right; position:absolute;right:0px;padding-top:-50px\"><img height=\"50\" width=\"180\" src=\"${basePath}/resources/upload/logo.png\"/></div>\n\n<table  border=\"1\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#CCCCCC\"  style=\"margin:40px 0px 0px 0px;width:100%;padding-top:40px\">\n     <tr height=\"20px\">\n		<td style=\"text-align:center\" ><span>发货日期</span></td>\n		<td colspan=\"4\"><span>${shipmentDate}</span></td>\n		<td style=\"text-align:center\"  colspan=\"2\"><span>发货单编号</span></td>\n		<td><span>${shipmentNum}</span></td>\n    </tr>\n<tr height=\"20px\">\n		<td style=\"text-align:center\" ><span>客户名称</span></td>\n		<td colspan=\"4\"><span>${customerName}</span></td>\n		<td style=\"text-align:center\"  colspan=\"2\"><span>客户地址</span></td>\n		<td><span>${cusAddress}</span></td>\n    </tr>\n    <tr height=\"20px\">\n		<td style=\"text-align:center\" ><span>运输方式</span></td>\n		<td colspan=\"2\"><span><#if (transportMethod)??>${transportMethod}<#else></#if></span></td>\n		<td style=\"text-align:center\"  colspan=\"2\"><span>收货联系人</span></td>\n		<td style=\"text-align:center\" ><span>${cusPersonName}</span></td>\n                <td style=\"text-align:center\" ><span>联系电话</span></td>\n		<td style=\"text-align:center\" ><span>${cusTelephone}</span></td>\n    </tr>			\n    <tr height=\"20px\">\n		<td style=\"text-align:center\"  class=\"even\"><span>产品名称</span></td>\n		<td style=\"text-align:center\"  class=\"opp\"><span> 幅宽[mm]</span></td>\n\n		<td style=\"text-align:center\"  class=\"opp\"><span>切长[mm]</span></td>\n	\n		<td style=\"text-align:center\"  class=\"opp\"><span>件数</span></td>\n		<td style=\"text-align:center\"  class=\"opp\"><span>重量[T]</span></td>\n                <td style=\"text-align:center\"  class=\"odd\">实收件数</td>\n                <td style=\"text-align:center\"  class=\"odd\">实收重量[T]</td>\n                <td style=\"text-align:center\"  class=\"even\">备注</td>\n    </tr>\n<#list shipmentLine as tlist>\n<tr height=\"20px\">\n		<td style=\"text-align:center\"  class=\"even\"><span><#if (tlist.itemName)??>${tlist.itemName}<#else></#if></span></td>\n		<td colspan=\"2\" style=\"text-align:center;width:40px;font-size:12px;\"><span><#if (tlist.attributeNameValue)??>${tlist.attributeNameValue}<#else></#if></span></td>\n		<td style=\"text-align:center\"  class=\"opp\"><span></span></td>\n<#if shipmentType==\"R\" >\n		<td style=\"text-align:center\"  class=\"opp\"><span><#if (tlist.quantity)??>-${tlist.quantity}<#else></#if></span></td>\n</#if>\n<#if shipmentType==\"S\" >\n		<td style=\"text-align:center\"  class=\"opp\"><span><#if (tlist.quantity)??>${tlist.quantity}<#else></#if></span></td>\n</#if>\n                <td style=\"text-align:center\"  class=\"odd\"></td>\n                <td style=\"text-align:center\"  class=\"odd\"></td>\n                <td style=\"text-align:center\"  class=\"even\"><#if (tlist.specialRequirement)??>${tlist.specialRequirement}<#else></#if></td>\n    </tr>\n</#list>\n   <tr height=\"20px\">\n		<td style=\"text-align:right\" colspan=\"3\"><span>合计：</span></td>\n		<td><span></span></td>\n<#if shipmentType==\"S\" >\n                <td style=\"text-align:center\"><span>${totalQuantity}</span></td>\n</#if>\n<#if shipmentType==\"R\" >\n                <td style=\"text-align:center\"><span>-${totalQuantity}</span></td>\n</#if>\n		<td style=\"text-align:center\"  colspan=\"2\"><span>客户签字盖章</span></td>\n		<td><span></span></td>\n    </tr>\n   <tr height=\"20px\">\n		<td style=\"text-align:center\" ><span>提单号</span></td>\n		<td colspan=\"4\"><span></span></td>\n		<td style=\"text-align:center\"  colspan=\"2\"><span>箱号</span></td>\n		<td><span></span></td>\n    </tr>\n<tr height=\"20px\">\n		<td style=\"text-align:center\" ><span>车牌号</span></td>\n		<td colspan=\"4\"><span></span></td>\n		<td style=\"text-align:center\"  colspan=\"2\"><span>铅封号</span></td>\n		<td><span></span></td>\n    </tr>\n   <tr height=\"20px\">\n		<td style=\"text-align:center\" ><span>司机签字</span></td>\n		<td colspan=\"2\"><span></span></td>\n		<td style=\"text-align:center\"  colspan=\"2\"><span>审核人</span></td>\n		<td><span></span></td>\n                <td style=\"text-align:center\" ><span>制单人</span></td>\n		<td><span>${userName}</span></td>\n    </tr>	\n\n</table>\n</body>\n</html>','Y',NULL,'Y',-1,-1,22,'2017-05-15 15:06:54',10001,10001,'2017-06-14 10:36:46',10001,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'ITF_SAP_CUSTOMER_OVERDUE','客户逾期查询接口模板','<soapenv:Envelope xmlns:soapenv=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:sen=\"http://www.wanggreat/ec/overdue/sender\">\n   <soapenv:Header/>\n   <soapenv:Body>\n      <sen:MT_OVERDUE_SENDER_REQ>\n         <CREDITCONTROLAREA>1021</CREDITCONTROLAREA>\n         <CUSTOMER_NO>${customerNum!}</CUSTOMER_NO>\n      </sen:MT_OVERDUE_SENDER_REQ>