ng\"/></div>\n</div>\n<div style=\"float:left;width:500px;padding-top:10px;padding-bottom:15px\">\n<div style=\"text-align:center;\">\n<h2>上海王的实业有限公司对账单</h2>\n</div>\n</div>\n\n<table  border=\"0\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#CCCCCC\"  style=\"width:100%;font-size:12px;margin-bottom:0px \">\n         <tr height=\"14px\">\n		<td class=\"odd\" style=\"text-align:right;\"><span>客户名称：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${partyName}</span></td>\n		<td class=\"odd\" style=\"text-align:right;\"><span> 客户编码：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${customerNumber}</span></td>\n               <td class=\"odd\" style=\"text-align:right;\"><span> 所在区域：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${address}</span></td>\n	</tr>\n        <tr height=\"14px\">\n		<td class=\"odd\" style=\"text-align:right;\"><span>对账单编号：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${statementNumber}</span></td>\n		<td class=\"odd\" style=\"text-align:right;\"><span>币种：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${currency}</span></td>\n               <td class=\"odd\" style=\"text-align:right;\"><span> 税率：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${rate}</span></td>\n	</tr>\n        <tr height=\"14px\">\n		<td class=\"odd\" style=\"text-align:right;\"><span>结算类型：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${settleType}</span></td>\n		<td class=\"odd\" style=\"text-align:right;\"><span>账期：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${paymentDays!}</span></td>\n               <td class=\"odd\" style=\"text-align:right;\"><span> 备注信息：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${comments}</span></td>\n	</tr>	\n\n        <tr height=\"14px\">\n		<td class=\"odd\" style=\"text-align:right;\"><span>现金收货总金额：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${cashTotalAmount!}</span></td>\n		<td class=\"odd\" style=\"text-align:right;\"><span>白条收货金额：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${whileTotalAmount!}</span></td>\n               <td class=\"odd\" style=\"text-align:right;\"><span> 票据收货金额：</span></td>\n		<td class=\"even\" style=\"text-align:lefft;\"><span>${billTotalAmount!}</span></td>\n	</tr>	\n        <tr height=\"14px\">\n		<td class=\"odd\" style=\"text-align:right;\"><span>收货总金额：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${receiveTotalAmount!}</span></td>\n		<td class=\"odd\" style=\"text-align:right;\"><span>调整金额：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${adjustmentTotalAmount!}</span></td>\n               <td class=\"odd\" style=\"text-align:right;\"><span> 对账单金额：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${totalAmount!}</span></td>\n	</tr>	\n        <tr height=\"14px\">\n		<td class=\"odd\" style=\"text-align:right;\"><span>对账单状态：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${statementStatus}</span></td>\n		<td class=\"odd\" style=\"text-align:right;\"><span>创建日期：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${creationDate}</span></td>\n               <td class=\"odd\" style=\"text-align:right;\"><span> 确认日期：</span></td>\n		<td class=\"even\" style=\"text-align:left;\"><span>${confirmDatetime!}</span></td>\n	</tr>	\n</table>\n\n<table border=\"1\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#CCCCCC\" style=\"margin:40px 0px 0px 0px;width:100%;font-size:12px;\">\n       <tr height=\"25px\">\n       <td colspan=\"12\" style=\"text-align:center;background-color:#E7E8ED;\"><span>收货信息</span></td>\n       </tr>\n	<tr height=\"25px\">\n		<td style=\"text-align:center;width:40px;\"><span>序号</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>收货日期</span></td>\n                <td style=\"text-align:center;width:90px;\"><span>商品名称</span></td>\n		<td style=\"text-align:center;width:90px;\"><span>可变属性</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>收货数量</span></td>\n                <td style=\"text-align:center;width:40px;\"><span>单价</span></td>\n　　　　　<td style=\"text-align:center;width:40px;\"><span>总价</span></td>\n               <td style=\"text-align:center;width:50px;\"><span>支付方式</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>销售订单号</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>销售订单行号</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>收货单号</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>收货单行号</span></td>\n	</tr> \n<#if recLine?exists>\n<#list recLine as rec>\n       <tr height=\"25px\">\n		<td style=\"text-align:center;width:40px;\"><span>${rec.lineNum!}</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>${rec.recDate?date!}</span></td>\n                <td style=\"text-align:center;width:90px;\"><span>${rec.itemName!}</span></td>\n		<td style=\"text-align:center;width:90px;\"><span>${rec.attributeNameValue!}</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>${rec.receiveQuantity!}</span></td>\n                <td style=\"text-align:center;width:40px;\"><span>${rec.unitPrice!}</span></td>\n　　　　　<td style=\"text-align:center;width:40px;\"><span>${rec.totalAmount!}</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>${rec.payMethod!}</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>${rec.orderHeaderNumber!}</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>${rec.orderLineNum!}</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>${rec.receiveNumber!}</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>${rec.receivelineNum!}</span></td>\n	</tr>\n</#list>\n<#else></#if>\n       <tr height=\"25px\">\n       <td colspan=\"12\" style=\"text-align:center;background-color:#E7E8ED;\"><span>调整信息</span></td>\n       </tr>\n	<tr height=\"25px\">\n		<td style=\"text-align:center;width:40px;\"><span>序号</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>调整单号</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>调整单价</span></td>\n		<td style=\"text-align:center;width:50px;\"><span>调整数量</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>调整总价</span></td>\n　　　　　<td colspan=\"3\" style=\"text-align:center;width:50px;\"><span>销售订单号</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>收货单号</span></td>\n　　　　　<td style=\"text-align:center;width:60px;\"><span>收货单行号</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>调整原因</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>创建日期</span></td>\n	</tr> \n<#if adjLine?exists>\n<#list adjLine as adj>\n	<tr height=\"25px\">\n		<td style=\"text-align:center;width:40px;\"><span>${adj.lineNum!}</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>${adj.adjustNumber!}</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>${adj.adjustUnitPrice!}</span></td>\n		<td style=\"text-align:center;width:50px;\"><span>${adj.adjustQuantity!}</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>${adj.totalAmount!}</span></td>\n　　　　　<td colspan=\"3\" style=\"text-align:center;width:10px;\"><span>${adj.orderNumber!}</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>${adj.receiveNumber!}</span></td>\n　　　　　<td style=\"text-align:center;width:60px;\"><span>${adj.receivelineNum!}</span></td>\n                <td style=\"text-align:center;width:50px;\"><span>${adj.reasons!}</span></td>\n　　　　　<td style=\"text-align:center;width:50px;\"><span>${adj.adjDate?date!}</span></td>\n	</tr> \n</#list>\n</#if>\n</table>\n\n<table  border=\"0\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#CCCCCC\"  style=\"width:100%;font-size:12px;margin-top:10px\">\n         <tr height=\"14px\">\n               <td colspan=\"3\"><span>请确认数量、单价、金额、订单号等相关内容，如无异议，我司将据此对账单开票。</span></td>\n         </tr>\n         <tr height=\"14px\">\n               <td style=\"width:1px;\"></td>\n               <td colspan=\"2\" style=\"text-align:left;width:40px;\"><span>敬谢！</span></td>\n         </tr>\n         <tr height=\"14px\">\n                <td style=\"width:25px;\"></td>\n                <td style=\"text-align:left;width:400px;\"><span>公司确认(签字盖章)</span></td>\n                <td style=\"text-align:left;width:400px;\"><span>客户确认(签字盖章)</span></td>\n         </tr>\n         <tr height=\"14px\">\n                <td style=\"width:25px;\"></td>\n                <td style=\"text-align:left;width:400px;\"><span>日期:</span></td>\n                <td style=\"text-align:left;width:400px;\"><span>日期:</span></td>\n         </tr>\n</table>\n\n\n</body>\n</html>','Y',NULL,'Y',-1,-1,205,'2017-05-26 10:26:42',10001,10001,'2017-06-12 18:21:53',10001,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,'RP_SUPSTATEMENT','供应商对账单打印','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html>\n<head>\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\n<style  type=\"text/css\">  \nbody {font-family:SimHei; background:none;margin-left: auto;margin-right: auto;}  \nh2{text-align:center;padding-bottom:-20px;text-decoration:underline}\nbody,html,div,p,span{  margin:0px; padding:0px;}  \n.odd{width:65px;}\n.even{width:90px;}\n.opp{width:40px;}\n\n</style> \n</head>\n<body>\n<div style=\"float:left;padding-top:30px;padding-bottom:10px\">\n<div style=\"text-align:center;\"><img height=\"45\" width=\"120\" src=\"${basePath}/resources/upload/logo.png\"/></div>\n</div>\n<div style=\"float:left;width:500px;padding-top:10px;padding-bottom:15px\">\n<div style=\"text-align:cen