_supplier wms,\n			wg_md_trade_party wmtp\n\nWHERE  wms.trade_party_id=wmtp.trade_party_id\n<if test=\"supplierNumber!= null \">\n        AND wmtp.party_number LIKE #{supplierNumber}\n</if>\n<if test=\"supplierName!= null \">\n        AND wmtp.party_name LIKE #{supplierName}\n</if>\n<if test=\"sourceKey!= null \">\n        AND wms.source_key =#{sourceKey}\n</if>',1,''),(10016,'SET_FC_SUB_CLASS_LEVEL_CODE','层级代码选择','ForecastLevelMapper.selectForecastLevelCode','forecastLevelCode','forecastLevelCode','层级代码选择','700','300','层级代码选择','N','N','N','Y',19,-1,-1,10001,'2017-03-11 21:38:50',10001,'2017-03-27 16:56:28',10001,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',1,''),(10025,'DSM_ITEM_BRAND_UPDATE','查询商品编码','','itemId','itemCode','查询商品编码','600','300',NULL,'N','N','N','Y',3,-1,-1,10001,'2017-03-18 21:02:04',10001,'2017-04-18 15:34:54',10001,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'select\n item.item_id,\n item.item_code,item.description\n from wg_md_trade_item_attr_value attrV\n  left join wg_md_item_attribute attr \n       on attrV.item_attribute_id = attr.attribute_id  \n  left join wg_md_trade_item item on attrV.trade_item_id = item.item_id where attrV.attribute_value = #{brandCode} and  attr.attribute_code = #{attributeCode}',1,''),(10027,'FM_EXT_FC_LEVEL','附加预测层级选择','','forecastLevelId','forecastLevelCode','附加预测层级选择','500','400','附加预测层级选择','N','N','Y','Y',27,-1,-1,10001,'2017-03-21 19:35:34',10001,'2017-04-17 10:08:13',10001,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'SELECT\n	wsfl.forecast_level_id,\n	wsfl.forecast_level_code\nFROM\n	wg_set_forecast_level wsfl\nWHERE\n	wsfl.source_code != \'ITEM\'\nAND EXISTS (\n	SELECT\n		1\n	FROM\n		wg_set_forecast_assign wsfa\n	WHERE\n		wsfa.forecast_level_id = wsfl.forecast_level_id\n	AND wsfa.source_code = wsfl.source_code\n)',1,''),(10028,'DSM_SALE_FORECAST_CUSTOMER','客户名称','','customerId','partyName','客户名称','500'