f>\n<if test=\"description!= null \">\n        AND wmti.description LIKE #{description}\n</if>\n<if test=\"sourceKey!= null \">\n        AND wmti.source_key LIKE #{sourceKey}\n</if>',2,''),(10052,'FM_CALCULATE_INTERVAL_REGION','区域','','value','meaning','区域','500','400','区域','N','N','Y','Y',7,-1,-1,10001,'2017-06-05 17:19:46',10001,'2017-06-09 09:19:52',10001,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'SELECT\n	scvb.CODE_VALUE_ID,\n	scvb.`VALUE`,\n	scvb.MEANING\nFROM\n	sys_code_b scb,\n	sys_code_value_b scvb\nWHERE\n	scb.CODE_ID = scvb.CODE_ID\nAND scb.`CODE` = \'MD.SALE_REGION\'\n<if test=\"value !=null\">\nAND scvb.`VALUE` LIKE #{value}\n</if>\n<if test=\"meaning!=null\">\nAND scvb.MEANING LIKE #{meaning}\n</if>',2,''),(10053,'FM_CALCULATE_INTERVAL_FORECAST','预测层级必填','','forecastLevelId','forecastLevelCode','预测层级必填','470','400','预测层级必填','N','N','Y','Y',16,-1,-1,10001,'2017-06-05 19:28:00',10001,'2017-06-07 10:49:03',10001,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'SELECT\n	wsfl.forecast_level_id,\n	wsfl.forecast_level_code\nFROM\n	wg_set_forecast_level wsfl\nWHERE\n	wsfl.enabled_flag=\'Y\'\nAND\n	wsfl.confirm_flag=\'Y\'\nAND\n	wsfl.source_code=\'ITEM\'\n<if test=\"forecastLevelCode != null\">\nAND \n       wsfl.forecast_level_code LIKE #{forecastLevelCode}\n</if>',1,''),(10054,'FM_CALCULATE_INTERVAL_EXT_FORECAST','附加预测层级必填','','forecastLevelId','forecastLevelCode','附加预测层级必填','500','400','附加预测层级必填','N','N','Y','Y',8,-1,-1,10001,'2017-06-05 19:34:43',10001,'2017-06-07 10:49:21',10001,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'SELECT\n	wsfl.forecast_level_id ,\n	wsfl.forecast_level_code\nFROM\n	wg_set_forecast_level wsfl\nWHERE\n	wsfl.enabled_flag=\'Y\'\nAND\n	wsfl.confirm_flag=\'Y\'\nAND\n	wsfl.source_code=\'OTH\'\n<if test=\"forecastLevelCode != null\">\nAND \n       wsfl.forecast_level_code LIKE #{forecastLevelCode}\n</if>',1,''),(10055,'LOV_TEST','lov测试