/*Table structure for table `tb_lov_item` */

DROP TABLE IF EXISTS `tb_lov_item`;

CREATE TABLE `tb_lov_item` (
  `LOV_ITEM_ID` bigint(20) NOT NULL AUTO_INCREMENT,
