  `CONDITION_FIELD_WIDTH` decimal(20,0) DEFAULT NULL COMMENT '查询字段宽度',
  `CONDITION_FIELD_TYPE` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段组件类型',
  `CONDITION_FIELD_NAME` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段名',
  `CONDITION_FIELD_NEWLINE` varchar(1) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段新一行',
  `CONDITION_FIELD_SELECT_CODE` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段combobox对应的快码值',
  `CONDITION_FIELD_LOV_CODE` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段lov对应的通用lov编码',
  `CONDITION_FIELD_SEQUENCE` decimal(20,0) DEFAULT NULL COMMENT '查询字段排序号',
  `CONDITION_FIELD_SELECT_URL` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段combobox对应的URL',
  `CONDITION_FIELD_SELECT_VF` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段combobox对应的valueField',
  `CONDITION_FIELD_SELECT_TF` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段combobox对应的textField',
  `CONDITION_FIELD_TEXTFIELD` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '查询字段对应的textField',
  `AUTOCOMPLETE_FIELD` varchar(1) COLLATE utf8_bin DEFAULT 'Y' COMMENT 'autocomplete显示列',
  `GRID_FIELD` varchar(1) COLLATE utf8_bin DEFAULT 'Y' COMMENT '是否显示表格列',
  `GRID_FIELD_NAME` varchar(80) COLLATE utf8_bin DEFAULT NULL COMMENT '表格列字段名',
  `GRID_FIELD_SEQUENCE` decimal(20,0) DEFAULT '1' COMMENT '表格列排序号',
  `GRID_FIELD_WIDTH` decimal(20,0) DEFAULT NULL COMMENT '表格列宽',
  `GRID_FIELD_ALIGN` varchar(10) COLLATE utf8_bin DEFAULT 'center' COMMENT '表格列布局',
  `OBJECT_VERSION_NUMBER` bigint(20) DEFAULT '1',
  `REQUEST_ID` bigint(20) DEFAULT '-1',
  `PROGRAM_ID` bigint(20) DEFAULT '-1',
  `CREATED_BY` bigint(20) DEFAULT '-1',
  `CREATION_DATE` datetime DEFAULT CURRENT_TIMESTAMP,
  `LAST_UPDATED_BY` bigint(20) DEFAULT '-1',
  `LAST_UPDATE_DATE` datetime DEFAULT CURRENT_TIMESTAMP,
  `LAST_UPDATE_LOGIN` bigint(20) DEFAULT '-1',
  `ATTRIBUTE_CATEGORY` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE1` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE2` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE3` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE4` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE5` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE6` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE7` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE8` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE9` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE10` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE11` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE12` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE13` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE14` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE15` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `CONDITION_FIELD_LABEL_WIDTH` decimal(10,0) DEFAULT NULL,
  PRIMARY KEY (`LOV_ITEM_ID`),
  KEY `SYS_LOV_ITEM_N1` (`LOV_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=10105 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

