/*Table structure for table `tb_message` */

DROP TABLE IF EXISTS `tb_message`;

CREATE TABLE `tb_message` (
  `MESSAGE_ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `MESSAGE_TYPE` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '信息类型,email/sms',
  `MESSAGE_HOST` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '消息服务器',
  `MESSAGE_FROM` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '消息发出人',
  `SUBJECT` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT ' 标题',
  `CONTENT` longtext COLLATE utf8_bin COMMENT '内容',
  `PRIORITY_LEVEL` varchar(25) COLLATE utf8_bin DEFAULT NULL COMMENT '优先级',
  `SEND_FLAG` varchar(1) COLLATE utf8_bin DEFAULT 'N' COMMENT '发送标记',
  `MESSAGE_SOURCE` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '消息来源',
  `OBJECT_VERSION_NUMBER` bigint(20) DEFAULT '1',
  `REQUEST_ID` bigint(20) DEFAULT '-1',
  `PROGRAM_ID` bigint(20) DEFAULT '-1',
  `CREATED_BY` bigint(20) DEFAULT '-1',
  `CREATION_DATE` datetime DEFAULT CURRENT_TIMESTAMP,
  `LAST_UPDATED_BY` bigint(20) DEFAULT '-1',
  `LAST_UPDATE_DATE` datetime DEFAULT CURRENT_TIMESTAMP,
  `LAST_UPDATE_LOGIN` bigint(20) DEFAULT '-1',
  `ATTRIBUTE_CATEGORY` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE1` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE2` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE3` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE4` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE5` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE6` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE7` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE8` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE9` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE10` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE11` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE12` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE13` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE14` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  `ATTRIBUTE15` varchar(240) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`MESSAGE_ID`),
  KEY `tb_MESSAGE_N1` (`MESSAGE_TYPE`)
) ENGINE=InnoDB AUTO_INCREMENT=293 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

