/*Table structure for table `tb_message_account` */

DROP TABLE IF EXISTS `tb_message_account`;

CREATE TABLE `tb_message_account` (
  `ACCOUNT_ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `ACCOUNT_TYPE` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '账号类型',
  `ACCOUNT_CODE` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '编号',
